import React from 'react';
import Main from './Pages/MainPage/Main'
var Ons = require('onsenui');
var ROns = require('react-onsenui');


class TabBar extends React.Component{
   
    renderTabs() {
        const sections = [Main];

        return sections.map((page) => {
          return {
            content: <page navigator={this.props.navigator} />,
            tab: <ROns.Tab key={page.props.key} label={page.props.title} />
          };
        });
      }

      

      render() {
        return (
          <ROns.Page>
            <ROns.Tabbar
              initialIndex={0}
              renderTabs={this.renderTabs.bind(this)}
            />
          </ROns.Page>
        );
      }
}


export default TabBar;
